script: |
  super -f text -I q11323.spq | sort > q11323.out

inputs:
  - name: q11323.spq
    data: |
      SELECT - col1 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT + col2 NOT BETWEEN - CAST ( + - 92 AS INTEGER ) AND + col1 * + 32 / col2 * - + ( ( - col0 ) ) + + 59 / + col2 + + - 97;
  - name: tab0

outputs:
  - name: q11323.out
    data: |
